import "./topBar.css";
import girlTop from './images/beauty.png';

function TopBar() {
  return (
    <div className="top">
      <div className="topLeft">Facebook Twitter Pinterest Instagram</div>
      <div className="topCenter">
        <ul className="topList">
          <li className="topIcon topListItem">HOME</li>
          <li className="topIcon topListItem">ABOUT</li>
          <li className="topIcon topListItem">CONTACT</li>
          <li className="topIcon topListItem">WRITE</li>
          <li className="topIcon topListItem">LOGOUT</li>
        </ul>
      </div>
      <div className="topRight"> 
          <img src={girlTop} className="topImg" alt=""/>
          <i class="fa-solid fa-magnifying-glass"></i>
          </div>
    </div>
  );
}

export default TopBar;
